import React from 'react';
// import HelloWorld from './Components/HelloWorld';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Sidebar from './Components/Sidebar';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import { HomePage } from './Pages/HomePage';
import { ContactPage } from './Pages/ContactPage';
import { AboutPage } from './Pages/AboutPage';
import { DateVotingPage } from './Pages/DateVotingPage';
import { ParticipationListPage } from './Pages/ParticipationListPage';
import { FinanceReportPage } from './Pages/FinanceReportPage';
import { LocationPage } from './Pages/LocationPage';
import { TransportPage } from './Pages/TransportPage';
import { CateringPage } from './Pages/CateringPage';
import { ActivitiesPage } from './Pages/ActivitiesPage';
import { EntertainmentPage } from './Pages/EntertainmentPage';

const App = () => {
  return (
    // <div className="app-container">
    //   <Header />    
    //   <HelloWorld />
    //   <Sidebar />
    //   <Footer />
    // </div>
    // <RoutesMapping />
    <Router>
      <div className="app-container">
        <Header />    
        {/* <HelloWorld /> */}
        <Sidebar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/contact/:contactId" element={<ContactPage />} />
          <Route path="/dateVoting/:dateVotingID" element={<DateVotingPage />} />
          <Route path="/participationlist/:participationlistId" element={<ParticipationListPage />} />
          <Route path="/about/:aboutId" element={<FinanceReportPage />} />
          <Route path="/about/:aboutId" element={<LocationPage />} />
          <Route path="/about/:aboutId" element={<TransportPage />} />
          <Route path="/about/:aboutId" element={<CateringPage />} />
          <Route path="/about/:aboutId" element={<ActivitiesPage />} />
          <Route path="/about/:aboutId" element={<EntertainmentPage />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
